import React from 'react'

const EmployeeList = (props) => {
    const {empData} = props;
    console.log(empData)

  return (
    <div>
      <ol>
                {
                   empData?.map((value, index)=>(
                    <li key={index}>
                        <span>{value.fullName}</span>
                    </li>
                   )) 
                }
            </ol>
    </div>
  )
}

export default EmployeeList
